    false,nt"url": null,nt"notes": "This data set is a digital representation
    of the printed 1:250,000 geologic maps from the Tennessee Department of Environment
    and Conservation, Division of Geology. The coverage was designed primarily to provide
    a more detailed geologic base than the 1:2,500,000 King and Beikman (1974). 1:24,000
    scale coverage of the state is available for about 40 percent of the state. Formation
    names and geologic unit codes used in the coverage are from the Tennessee Division
    of Geology published maps and may not conform to USGS nomenclature. The Tennessee
    Division of Geology can be contacted at (615) 532-1500",nt"license_title":
